window.onload = function() {
	lBar.set(100);
	mySwiper = new Swiper('.swiper-container',{
	    mode:'horizontal',
	    loop: true
	 });  
};

var $spinnerLeft = $('.left-spinner');
var $spinnerRight = $('.right-spinner');

$spinnerLeft.on('click', function() {
	mySwiper.swipePrev();
});
$spinnerRight.on('click', function() {
	mySwiper.swipeNext();
});

var $sign = $('.sign');
var $paper = $('.paper');
var $langSelect = $('.lang-select');
var $linkPortfolio = $('.link-portfolio');

(function(namespace) {
    if ('replaceState' in history) {
        namespace.replaceHash = function(newhash) {
            if ((''+newhash).charAt(0) !== '#') newhash = '#' + newhash;
            history.replaceState('', '', newhash);
        }
    } else {
        var hash = location.hash;
        namespace.replaceHash = function(newhash) {
            if (location.hash !== hash) history.back();
            location.hash = newhash;
        };
    }
})(window);

var setLanguage = function(lang) {
	if (lang === 'ru') {
		window.replaceHash('ru');
		$langSelect.set('$', '+ru -en');
		$sign.set('$', '+ru -en');
		$paper.set('$', '+ru -en');
	} else {
		window.replaceHash('en');
		$langSelect.set('$', '-ru +en');
		$sign.set('$', '-ru +en');
		$paper.set('$', '-ru +en');
	}
	$linkPortfolio.set('href', "./portfolio.html" + window.location.hash);
};

if (window.location.hash === '#ru') {
	setLanguage('ru');
}

$langSelect.on('click', function() {
	if ($langSelect.is('.en')) {
		setLanguage('ru');
	} else {
		setLanguage('en');
	}
});